import styled from 'styled-components';

export const Container = styled.div`
  height: 100vh;
  display: flex;
`;

export const Content = styled.div``;

export const Nav = styled.nav`
  display: flex;
  background: #373737;
  color: #c0b283;
  height: 50px;
  flex: 1;

  ul {
    /* background: red; */
    justify-content: center;
    align-items: center;
    strong {
      margin-left: 8px;
      color: #fff;
      font-size: 18px;
      font-weight: 300;
    }
  }

  li {
    /* background: blue; */
    display: inline;
    list-style: none;
    margin-left: 8px;

    a {
      text-decoration: none;
      color: #c0b283;
    }
  }
`;
